import { Route, Routes } from "react-router-dom"
import Home from ""
import { About } from "./pages/About"
import { Gigs } from "./pages/Gigs"

function App() {
  return (
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/about" element={<About />} />
      <Route path="/gigs" element={<Gigs />} />
    </Routes>
  );
}

export default App;
